			for (var i=0; i<27; ++i) lettersused[i] = 0;

			for (var tile=0 ; tile<7; ++tile)
				YAHOO.util.Dom.setStyle('racktile' + tile, 'display', 'none');

			var rackcount = Array(7, 7);
			var bagsize = 86;

			for (var m=0; m<letplays.length; ++m)
			{
				var moveinfo = letplays[m];
				if (moveinfo[0] <= move)
				{
					var word = moveinfo[1];
					var r = moveinfo[2];
					var c = moveinfo[3];
					var rdelta = moveinfo[4] ? 1 : 0;
					var cdelta = moveinfo[4] ? 0 : 1;
					var challenge = false;

					if (word != '---')
					{
						if (word.substr(0,5)=='-chl-')
						{
							word = word.substr(5);
							challenge = true;
						}

						for (var lc=0; lc<word.length; ++lc)
						{
							var l = word.charAt(lc);

							if (l!='.')
							{
								// Show on board
					   				var el = document.getElementById('cell' + r + '-' + c);
				    				el.innerHTML = l;
				    				el.style.display = challenge ? 'none' : 'block';
									if (moveinfo[0] == move)
										YAHOO.util.Dom.addClass(el, 'tilejustplayed');


								// Remove from pool (or add back, for challenges!)
									var ltridx = getletterindex(l);
									var idlett = (ltridx==26) ? 'blank' : l;

									if (!challenge)
									{
										var poolid = 'pool' + idlett + lettersused[ltridx];
										YAHOO.util.Dom.setStyle(poolid, 'display', 'none');
										++lettersused[ltridx];
										--rackcount[moveinfo[7]];
									}
									else
									{
										--lettersused[ltridx];
										var poolid = 'pool' + idlett + lettersused[ltridx];
										YAHOO.util.Dom.setStyle(poolid, 'display', 'block');
										++rackcount[moveinfo[7]];
									}
							}

							r += rdelta;
							c += cdelta;
						}

						//replenish (or give back, after challenge)
							var tiletransfer = Math.min(bagsize, 7-rackcount[moveinfo[7]]);
							bagsize -= tiletransfer;
							rackcount[moveinfo[7]] += tiletransfer;

					}
				}

				if (moveinfo[0] == move)
				{
	    			document.getElementById('score0').innerHTML = moveinfo[8];
