		function showitems(tag, vis, move)
		{
			gLastMove = '';
			var els = document.getElementsByTagName(tag);

			for (var img=0; img<els.length; img++)
			{
				el = els[img];

				var classname;

				  for (var k=0; k<el.attributes.length; k++) {
				    if (el.attributes.item(k).nodeName == 'class') {
				      classname = el.attributes.item(k).nodeValue;
				  } }

	//			var classname = el.getAttribute('class');

				if (classname && classname.substr(0,4) == 'move')
				{
					var movenum = parseInt(classname.substr(4));
					el.style.display = (movenum <= move) ? vis : 'none';

					if (movenum == move) 
					{
						gLastMove = gLastMove + ' ' + el.innerHTML;
