		function inttoascii(i)
		{
			// convert i into a 2-digit hex string
			var h = i . toString (16);
			if (h . length == 1)
				h = '0' + h;

			// insert a % character into the string
			h = '%' + h;

			// determine the character represented by the escape code
			h = unescape (h);

			return h;
		}

		function getletterindex(l)
		{
			if (l=='?') return 26;	// blank is 26

			// loop through all possible ASCII values
			var i;
			for (i = 0; i < 256; ++ i)
			{
				// if the characters match, we've found the ASCII value
				if (inttoascii(i) == l)
					break;
			}

			if (i > 90) return 26;	// a lower-case letter indicates a blank!
			return i-65;	// A=0, B=1, etc.
		}

		function nextmove()
		{
			if (gMove >= maxmove) { alert('There are no more moves to show'); return; }
			gMove++;
			showmove(gMove);

	//		if (gMove >= maxmove) document.getElementById('btn_forward').disable = true;
		}

		function prevmove()
		{
			if (!gMove) { alert('You\'re already at the start of the game'); return; }
			gMove--;		
			showmove(gMove);
		}

		function setDisplay(id, display)
		{
			document.getElementById(id).style.display = display;
		}

