		{
		    for (var r=0; r<15; ++r) for (var c=0; c<15; ++c) 
		    {
		        var el = document.getElementById('cell' + r + '-' + c);

		        el.innerHTML = '&nbsp;';
		        el.style.display = 'none';
				YAHOO.util.Dom.removeClass(el, 'tilejustplayed');
