		function showmove(move)
		{
		    gMove = move; 
		    document.getElementById('rack0').innerHTML = '&nbsp;';
		    document.getElementById('rack1').innerHTML = '&nbsp;';
			YAHOO.util.Dom.setStyle('lastmoveblock', 'display', 'none');
			YAHOO.util.Dom.setStyle('notesblock', 'display', 'none');
			//showitems('div', 'block', move);
			showitems('td', '' /* the default! */, move);

			cleargrid();
			clearmoveselectors();

			YAHOO.util.Dom.addClass('moveselector' + move, 'movecurselector');

			var lettersused = Array();
			for (var i=0; i<27; ++i) lettersused[i] = 0;

			for (var tile=0 ; tile<7; ++tile)
				YAHOO.util.Dom.setStyle('racktile' + tile, 'display', 'none');

			var rackcount = Array(7, 7);
			var bagsize = 86;

			for (var m=0; m<letplays.length; ++m)
			{
				var moveinfo = letplays[m];
				if (moveinfo[0] <= move)
				{
					var word = moveinfo[1];
					var r = moveinfo[2];
					var c = moveinfo[3];
					var rdelta = moveinfo[4] ? 1 : 0;
					var cdelta = moveinfo[4] ? 0 : 1;
					var challenge = false;

					if (word != '---')
					{
						if (word.substr(0,5)=='-chl-')
						{
							word = word.substr(5);
							challenge = true;
						}

						for (var lc=0; lc<word.length; ++lc)
						{
							var l = word.charAt(lc);

							if (l!='.')
							{
								// Show on board
					   				var el = document.getElementById('cell' + r + '-' + c);
				    				el.innerHTML = l;
				    				el.style.display = challenge ? 'none' : 'block';
									if (moveinfo[0] == move)
										YAHOO.util.Dom.addClass(el, 'tilejustplayed');


								// Remove from pool (or add back, for challenges!)
									var ltridx = getletterindex(l);
									var idlett = (ltridx==26) ? 'blank' : l;

									if (!challenge)
									{
										var poolid = 'pool' + idlett + lettersused[ltridx];
										YAHOO.util.Dom.setStyle(poolid, 'display', 'none');
										++lettersused[ltridx];
										--rackcount[moveinfo[7]];
									}
									else
									{
										--lettersused[ltridx];
										var poolid = 'pool' + idlett + lettersused[ltridx];
										YAHOO.util.Dom.setStyle(poolid, 'display', 'block');
										++rackcount[moveinfo[7]];
									}
							}

							r += rdelta;
							c += cdelta;
						}

						//replenish (or give back, after challenge)
							var tiletransfer = Math.min(bagsize, 7-rackcount[moveinfo[7]]);
							bagsize -= tiletransfer;
							rackcount[moveinfo[7]] += tiletransfer;

					}
				}

				if (moveinfo[0] == move)
				{
	    			document.getElementById('score0').innerHTML = moveinfo[8];
	    			document.getElementById('score1').innerHTML = moveinfo[9];
				}

				if (moveinfo[0] == move && moveinfo[10].length)
				{
					var thenotes = '';
					for (var i=0; i<moveinfo[10].length; ++i)
						thenotes += '<' + 'li>' + moveinfo[10][i] + '<' + '/li>';
					document.getElementById('notelist').innerHTML = '<' + 'ul>' + thenotes + '<' + '/ul>';
					YAHOO.util.Dom.setStyle('notesblock', 'display', 'block');
				}

				if (moveinfo[0] == move)
				{
					//new Ajax.Updater('comments', 'https://www.haloscan.com/comments/slipkin/NAME/?m=1', {asynchronous:true, evalScripts:true});
					//	document.getElementById('comments').innerHTML = '<span class="post-comment-link"><' + 'script src="" type="text/javascript"></'+'script>>';
				}

				if (moveinfo[0] == move+1) 
				{
					document.getElementById('rack' + moveinfo[7]).innerHTML = moveinfo[6];
				}

				if (moveinfo[0] == move)
				{
					document.getElementById('lastrack').innerHTML = moveinfo[6];

					if (gLastMove)
					{
						document.getElementById('lastmove').innerHTML = gLastMove;
						YAHOO.util.Dom.setStyle('lastmoveblock', 'display', 'block');
					}
				}

				if (moveinfo[0] == move+1)
				{
					var tile;

					for (tile=0; tile<moveinfo[6].length; ++tile)
					{
						var l;
						l = moveinfo[6].charAt(tile);
						var ltridx = getletterindex(l);
						var idlett = (ltridx==26) ? 'blank' : l;
						var poolid = 'pool' + idlett + lettersused[ltridx];
						var rackid = 'racktile' + tile;

						document.getElementById(rackid).innerHTML = l;
						YAHOO.util.Dom.setStyle(rackid, 'display', 'block');

						YAHOO.util.Dom.setStyle(poolid, 'display', 'none');
						++lettersused[ltridx];
					}

					var unknowntiles = rackcount[moveinfo[7]] - tile;
					if (unknowntiles > 0)
					{
						document.getElementById('partialrackwarning').innerHTML = ", including <b>" + unknowntiles + "</" + "b> unknown " + ((unknowntiles==1)?"tile":"tiles")+ " from current player's rack";
					}
					YAHOO.util.Dom.setStyle('partialrackwarning', 'display', unknowntiles ? 'inline' : 'none');

					for ( ; tile<7; ++tile)
					{
						YAHOO.util.Dom.setStyle('racktile' + tile, 'display', 'none');
					}

				}
			}

			hashParts[0] = move;
			location.hash = hashParts.join('#');
		}

		function inttoascii(i)
		{
			// convert i into a 2-digit hex string
			var h = i . toString (16);
			if (h . length == 1)
				h = '0' + h;

			// insert a % character into the string
			h = '%' + h;

			// determine the character represented by the escape code
			h = unescape (h);

			return h;
		}

		function getletterindex(l)
		{
			if (l=='?') return 26;	// blank is 26

			// loop through all possible ASCII values
			var i;
			for (i = 0; i < 256; ++ i)
			{
				// if the characters match, we've found the ASCII value
				if (inttoascii(i) == l)
					break;
			}

			if (i > 90) return 26;	// a lower-case letter indicates a blank!
			return i-65;	// A=0, B=1, etc.
		}

